// SPDX-License-Identifier: MIT

pragma solidity ^0.8.4;
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";


interface VotingPollInterface {
    function getVoteOwner () external view returns(address);
    function getVoteTitle () external view returns(string memory);
    function getVoteNumber () external view returns(uint);
    function getVoteOptions () external view returns(string[] memory);
    function getStatus () external view returns(bool);
}

contract VotingFactoryOld {
    uint256 pollCount;
    struct Vote {
        address owner;
        string title;
        string[] options;
        bool status;
    }
    mapping (uint256 => mapping(address => int )) votingResult;
    mapping (uint256 => address) idToOwner;
    Vote[] votingList;
    address public constant VOTTING_POLL_ADDRESS = 0x39930cf2Af45a2cD284664663b11CE0BB4AD1125;
    VotingPollInterface VotingPoll =  VotingPollInterface(VOTTING_POLL_ADDRESS);
    
    constructor () {
        pollCount = 0;
    }

    function addVotignPoll() external {
        address _owner = VotingPoll.getVoteOwner();
        require(msg.sender == _owner, "You are not owner!");
        string memory _title = VotingPoll.getVoteTitle();
        // require(_title.length != 0, "Voting Poll does not exist!");
        uint _number = VotingPoll.getVoteNumber();
        require(_number != 0, "Voting Poll does not exist!");
        string[] memory _options = VotingPoll.getVoteOptions();
        bool _status = VotingPoll.getStatus();

        Vote storage buff = votingList[pollCount];
        buff.owner = _owner;
        buff.title = _title;
        buff.options = _options;
        buff.status = _status;

        idToOwner[pollCount] = msg.sender;
        pollCount ++;
    }

    function vote (uint256 _id, int _value) external {
        require(votingList[_id].status = false, "Voting Was not Fihished");
        votingResult[_id][msg.sender] = _value;
    }
}
